                <button className="w3-close w3-bar-item w3-button w3-hide-large" onClick={this.close}>Close</button> 
                <a href="/cities" className="w3-bar-item w3-button">Cities</a> 
                <a href="..." className="w3-bar-item w3-button">2</a> 
                <a href="..." className="w3-bar-item w3-button">3</a>
            </div>
        );
    }
}

